window.bookSummaryJSON = "<p><b>He was kissing her with a fury that threatened to devour her. She needed this. Needed the wrath and the desire. One last time.</b></p> <p><b>Gwen</b> is a prisoner of the man she loves…</p> <p>In the battle for Avalon, she sided with <b>Mordred</b>’s enemies and allowed the demon Grinn to grow more powerful than ever.</p> <p><b>Passion still burns fiercely</b> between Mordred and Gwen. But the dark prince crushes his emotions and tells Gwen that he is sending her home. That she will never see Avalon—or him—again.</p> <p>But Avalon has ideas of its own. The magic of the island draws Gwen back and gifts her with stunning new abilities.</p> <p>Gwen has <b>one last chance to save the island</b> from a devastating war that would destroy everything—and everyone—she has come to love. But can she tame Mordred’s rage and pride? And can a demon ever be trusted?</p> <p><b>Continuing a heart-racing series of dark romance and seductive villains that’s perfect for fans of Sarah J. Maas, Elise Kova and Danielle L. Jensen, </b><b><i>To Break a Dark Cage</i></b><b> will transport you to a world of wonder and danger, and leave you breathless.</b></p>"; 
